import classes from "./NewPost.module.css"

function NewPost() {
    return (<form className={classes}>
        <label className={
                classes.author
            }
            forHTML="author">Author</label>
        <input id="author" type="text"></input><br/>
        <label className={
                classes.book
            }
            forHTML="book">Book</label>
        <textarea id="book"
            rows={3}></textarea>
    </form>)
}
export default NewPost;
